"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[8103],{9297:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2024/03/10/components","metadata":{"permalink":"/iuiu/blog/2024/03/10/components","source":"@site/blog/2024-03-10-components/index.mdx","title":"Components","description":"Hello, world!","date":"2024-03-10T00:00:00.000Z","formattedDate":"March 10, 2024","tags":[{"label":"updates","permalink":"/iuiu/blog/tags/updates"}],"readingTime":2.315,"hasTruncateMarker":true,"authors":[{"name":"Keith","title":"Maintainer @ Kitiplex","url":"https://github.com/mkeithX","imageURL":"https://github.com/mkeithX.png","key":"mkeithX"}],"frontMatter":{"title":"Components","authors":["mkeithX"],"tags":["updates"]},"unlisted":false,"nextItem":{"title":"Welcome","permalink":"/iuiu/blog/welcome"}},"content":"import CodeBlock from \'@theme/CodeBlock\';\\r\\nimport Tabs from \'@theme/Tabs\';\\r\\nimport TabItem from \'@theme/TabItem\';\\r\\n\\r\\n## Hello, world!\\r\\n\\r\\nPosting this update for testing purposes to ensure all plugins are properly configured. As a start, this article is trucated.\\r\\n\\r\\n{/*truncate*/}\\r\\n\\r\\n### Code higlight\\r\\n\\r\\n```js\\r\\nfunction HighlightSomeText(highlight) {\\r\\n  if (highlight) {\\r\\n    // highlight-next-line\\r\\n    return \'This text is highlighted!\';\\r\\n  }\\r\\n\\r\\n  return \'Nothing highlighted\';\\r\\n}\\r\\n\\r\\nfunction HighlightMoreText(highlight) {\\r\\n  // highlight-start\\r\\n  if (highlight) {\\r\\n    return \'This range is highlighted!\';\\r\\n  }\\r\\n  // highlight-end\\r\\n\\r\\n  return \'Nothing highlighted\';\\r\\n}\\r\\n```\\r\\n\\r\\n### Tabs\\r\\n\\r\\n\\r\\n<Tabs>\\r\\n<TabItem value=\\"js\\" label=\\"JavaScript\\">\\r\\n\\r\\n```js\\r\\nfunction helloWorld() {\\r\\n  console.log(\'Hello, world!\');\\r\\n}\\r\\n```\\r\\n\\r\\n</TabItem>\\r\\n<TabItem value=\\"py\\" label=\\"Python\\">\\r\\n\\r\\n```py\\r\\ndef hello_world():\\r\\n  print(\\"Hello, world!\\")\\r\\n```\\r\\n\\r\\n</TabItem>\\r\\n\\r\\n</Tabs>\\r\\n\\r\\n### npm2yarn remark plugin\\r\\n\\r\\n```bash npm2yarn\\r\\nnpm install @docusaurus/remark-plugin-npm2yarn\\r\\n```\\r\\n\\r\\n\\r\\n## Equation\\r\\n\\r\\n\\r\\n__$ Philosophiae Naturalis Principia Mathematica $__, better known as Principia is a monumental work that revolutionized our understanding the motion of objects and the force of gravity in the physical world.It introduced three fundamental laws of motion:\\r\\n\\r\\n### First Law (Inertia)\\r\\n**Statement**: An object at rest will remain at rest, and an object in motion will remain in motion with a constant velocity unless acted upon by a net external force.\\r\\n\\r\\n**In simpler terms**: Objects tend to stay as they are (either at rest or moving at a constant speed) unless something makes them change.\\r\\n\\r\\nThe first law is expressed by the equation:\\r\\n\\r\\n$$\\r\\nF = ma\\r\\n$$\\r\\n\\r\\nwhere:\\r\\n- $ F = $ is the force applied to an object,\\r\\n- $ m = $ is the mass of the object, and\\r\\n- $ a = $ is the acceleration produced by the applied force.\\r\\n\\r\\n### Second Law\\r\\n\\r\\n**Statement:** The acceleration of an object is directly proportional to the net force applied to it and inversely proportional to its mass. The direction of the acceleration is in the direction of the net force.\\r\\n\\r\\nEquation: $ F = ma $\\r\\n\\r\\n$ F=ma $ (Force equals mass times acceleration)\\r\\nIn simpler terms: The force acting on an object is equal to the mass of that object multiplied by its acceleration.\\r\\n\\r\\nThe second law, describing gravitational force, is given by:\\r\\n\\r\\n$$\\r\\n F = G \\\\cdot \\\\frac{m_1 \\\\cdot m_2}{r^2}\\r\\n$$\\r\\n\\r\\nwhere:\\r\\n- $ F = $ is the gravitational force between two masses,\\r\\n- $ G = $ is the gravitational constant,\\r\\n- $ ( m_1 ) $ and $ ( m_2 ) $ are the masses of the two objects, and\\r\\n- $ r $ is the separation between the centers of the masses.\\r\\n\\r\\n### Third Law\\r\\n\\r\\n**Statement:** For every action, there is an equal and opposite reaction. In other words, if object A exerts a force on object B, then object B simultaneously exerts a force of equal magnitude in the opposite direction on object A.\\r\\n\\r\\n**In simpler terms:** Every action has an equal and opposite reaction."},{"id":"welcome","metadata":{"permalink":"/iuiu/blog/welcome","source":"@site/blog/2024-03-10-iuiu/index.mdx","title":"Welcome","description":"","date":"2024-03-10T00:00:00.000Z","formattedDate":"March 10, 2024","tags":[{"label":"hello","permalink":"/iuiu/blog/tags/hello"},{"label":"welcome","permalink":"/iuiu/blog/tags/welcome"}],"readingTime":0,"hasTruncateMarker":false,"authors":[{"name":"Keith","title":"Maintainer @ Kitiplex","url":"https://github.com/mkeithX","imageURL":"https://github.com/mkeithX.png","key":"mkeithX"},{"name":"JoeiX","title":"Contributor @ Kitiplex","url":"https://github.com/JoeiX","imageURL":"https://github.com/JoeiX.png","key":"JoeiX"},{"name":"Venice","title":"Contributor @ Kitiplex","url":"https://github.com/Portiaporkshap","imageURL":"https://github.com/Portiaporkshap.png","key":"Venice"},{"name":"PriMx","title":"Contributor @ Kitiplex","url":"https://github.com/PriMaxima","imageURL":"https://github.com/PriMaxima.png","key":"Prim"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["mkeithX","JoeiX","Venice","Prim"],"tags":["hello","welcome"]},"unlisted":false,"prevItem":{"title":"Components","permalink":"/iuiu/blog/2024/03/10/components"}},"content":""}]}')}}]);